import React from "react";
import './styles/App.css';
import {BrowserRouter, Route} from "react-router-dom";
import AddProduct from "./pages/AddProduct";

function App() {
    return (
        <BrowserRouter>
            <Route path="/addproduct">
                <AddProduct/>
            </Route>
        </BrowserRouter>
    );
}


export default App;


